static void generate_rgb565_data(unsigned short* pbuffer, unsigned int w, unsigned int h, unsigned short* prgb565)
{
	int i;
	unsigned int x = (w - 64) / 2;
	unsigned int y = (h - 64) / 2;

	SCI_ASSERT(w >= 64);
	SCI_ASSERT(h >= 64);

	memset(pbuffer, 0xff, w*h*2);

	pbuffer += w * y;
	pbuffer += x;
	for (i=0; i<64; i++)
	{
		memcpy(pbuffer, prgb565, 64*2);
		pbuffer += w;
		prgb565 += 64;
	}
}

#define RGB8882RGB565(rgb888)   ((((rgb888)&0xf80000)>>8)|(((rgb888)&0xfc00)>>5)|(((rgb888)&0xf8)>>3))
#define RGB5652RGB888(rgb565)   (((((unsigned int)rgb565)&0xf800)<<8)|((((unsigned int)rgb565)&0x7e0)<<5)|((((unsigned int)rgb565)&0x1f)<<3))

static void generate_rgb888_data(unsigned int* pbuffer, unsigned int w, unsigned int h, unsigned short* prgb565)
{
	int i, j;
	unsigned int x = (w - 64) / 2;
	unsigned int y = (h - 64) / 2;

	SCI_ASSERT(w >= 64);
	SCI_ASSERT(h >= 64);

	memset(pbuffer, 0xff, w*h*4);

	pbuffer += w * y;
	pbuffer += x ;
	for (i=0; i<64; i++)
	{
	    for(j=0; j<64; j++)
	    {
	        *pbuffer = RGB5652RGB888(*prgb565);	   
    		pbuffer ++;
    		prgb565 ++;
        }
        pbuffer += 2*x;
	}
}




